import { configureStore } from "@reduxjs/toolkit";
import userReducer from "./userSlice";
import diaryReducer from "./diarySlice";  // ✅ Importăm reducer-ul Diary

const store = configureStore({
    reducer: {
        user: userReducer,
        diary: diaryReducer  // ✅ Adăugăm reducer-ul în Store
    }
});

export default store;
